import React from "react";
import { Container, Card, Button, Row, Col } from "react-bootstrap";
import exploitImage from "../assets/image-exploit.png";

const WebExploitation = () => {
  return (
    <Container
      fluid
      style={{ height: "100vh" }}
      className="d-flex align-items-center justify-content-center"
    >
      <Row className="w-100 justify-content-center">
        <Col md={8}>
          <div className="d-flex flex-column align-items-center">
            <img
              src={exploitImage}
              alt="exploit"
              className="img-fluid mb-4"
              style={{ maxWidth: "200px" }}
            />
            <Card className="shadow">
              <Card.Body>
                <Card.Title className="display-4">Web Exploitation</Card.Title>
                <Card.Text className="lead">
                  Welcome to the Web Exploitation category! Here you will find
                  challenges related to web security.
                  <br />
                  Test your skills in identifying vulnerabilities, exploiting
                  them, and securing web applications.
                </Card.Text>
                <Button variant="primary" size="lg">
                  Start Challenges
                </Button>
              </Card.Body>
            </Card>
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default WebExploitation;
